// Original file : https://github.com/jglim/ODB/blob/main/ODB/ObjectDB/BlowfishKeyTable.cs



pub fn get_blowfish_key_from_cid(cid: i32) -> Vec<u8> {
    let lut = get_cid_for_lut(cid) as usize;
    if lut > 0 || lut < 0x101 {
        println!("Fetching decryption key from Vendor ID {}", cid);
        return Vec::from(&BLOW_FISH_LUT[(32*lut)..(32*lut)+32]);
    }
    panic!("Vendor ID not within bounds, cannot generate key!");
}

fn get_cid_for_lut(cid: i32) -> i32 {
    if cid - 4 < 0 {
        panic!("Unknown client ID...Lowest client ID is 4, was given {}", cid);
    }
    cid - 3
}


